import './App.css';
import Header from './components/header';
import List from './components/list';
import { Route, Routes } from 'react-router-dom';
function App() {
  return (
    <Routes>
      <Route index element={
        <main>
          <Header />

          <List />
        </main>}
      />

      <Route >
        <div></div>
      </Route>

    </Routes>

  );
}

export default App;
